let currentQueue = [];
let currentLevel = null;
let currentSetId = null;
let isLocked = false;
let score = 0;
let streak = 0;
let missedScenarios = [];
let difficulty = 'normal'; // 'easy' (no timer), 'normal' (8s), 'hard' (5s), 'expert' (2s)
let gameTimeout = null;

function startTimer() {
    const timerContainer = document.getElementById('timer-container');
    const timerBar = document.getElementById('timer-bar');

    // Clear any existing
    clearTimeout(gameTimeout);
    timerBar.style.transition = 'none';
    timerBar.style.width = '100%';

    let duration = 0;
    if (difficulty === 'hard') duration = 5000;
    if (difficulty === 'expert') duration = 2500;
    if (difficulty === 'normal') duration = 10000; // Generous timer

    if (difficulty !== 'easy') {
        timerContainer.style.opacity = '1';
        // Force reflow
        void timerBar.offsetWidth;

        timerBar.style.transition = `width ${duration}ms linear`;
        timerBar.style.width = '0%';

        gameTimeout = setTimeout(() => {
            handleGuess(-1);
        }, duration);
    } else {
        timerContainer.style.opacity = '0';
    }
}

window.cycleDifficulty = function cycleDifficulty() {
    const modes = ['easy', 'normal', 'hard', 'expert'];
    let currentIdx = modes.indexOf(difficulty);
    let nextIdx = (currentIdx + 1) % modes.length;
    difficulty = modes[nextIdx];

    const label = document.getElementById('difficulty-label');
    label.innerText = difficulty.toUpperCase() + " PROTOCOL";

    // Visual Cues
    const container = document.querySelector('.hard-mode-controls');
    container.className = 'hard-mode-controls mode-' + difficulty;

    // Restart timer if mid-game
    if (!isLocked) startTimer();
}

function shuffle(array) {
    for (let i = array.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
    return array;
}

window.initGame = function initGame() {
    // Flatten all scenarios into a single queue
    let allScenarios = [];
    GAME_DATA.levels.forEach(set => {
        set.scenarios.forEach(scen => {
            // enrich scenario with its set ID so we know which bg to load
            allScenarios.push({ ...scen, parentSet: set.setId });
        });
    });

    currentQueue = shuffle(allScenarios);
    score = 0;
    streak = 0;
    missedScenarios = [];
    loadNextLevel();
    document.getElementById('game-over-screen').classList.remove('active');
}

function loadNextLevel() {
    if (currentQueue.length === 0) {
        setTimeout(() => {
            const gameOverScreen = document.getElementById('game-over-screen');
            gameOverScreen.classList.add('active');

            // Save High Score
            const storedHigh = localStorage.getItem('faces_highscore') || 0;
            if (score > storedHigh) {
                localStorage.setItem('faces_highscore', score);
            }
            const finalHigh = Math.max(score, storedHigh);

            // Generate Summary HTML
            const summaryDiv = document.getElementById('summary-content');

            let missedHtml = '';
            if (missedScenarios.length > 0) {
                missedHtml = '<div class="missed-list">' +
                    missedScenarios.map(m => `<span class="missed-tag">${m}</span>`).join('') +
                    '</div>';
            } else {
                missedHtml = '<div class="empty-missed">None! Perfect Analysis.</div>';
            }

            summaryDiv.innerHTML = `
                <div class="stat-row">
                    <span>Performance Rating</span>
                    <span class="stat-value">${score}</span>
                </div>
                <div class="stat-row">
                    <span>Historical Best</span>
                    <span class="stat-value">${finalHigh}</span>
                </div>
                <div class="missed-section">
                    <div class="missed-label">Micro-expressions to Study</div>
                    ${missedHtml}
                </div>
            `;

        }, 1500);
        return;
    }

    currentLevel = currentQueue.pop();

    // Text Scramble
    const targetDisplay = document.getElementById('target-display');
    let steps = 0;
    const targetText = currentLevel.name;
    const chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^&*';
    const interval = setInterval(() => {
        targetDisplay.innerText = targetText.split('').map((char, index) => {
            if (index < steps) return char;
            return chars[Math.floor(Math.random() * chars.length)];
        }).join('');
        steps += 1 / 3;
        if (steps >= targetText.length) clearInterval(interval);
    }, 30);

    // Set Background if changed
    if (currentLevel.parentSet !== currentSetId) {
        currentSetId = currentLevel.parentSet;

        // Fade out, switch, fade in? 
        // For now, instant switch
        const bgData = GAME_DATA.assets[currentSetId].full;
        document.querySelector(".grid-container").style.backgroundImage = `url(${bgData})`;
    }

    // Reset UI
    document.querySelectorAll('.arrow-indicator').forEach(el => el.classList.remove('visible'));
    document.getElementById('toast').classList.remove('show');
    isLocked = false;
    startTimer();
}

window.handleGuess = function handleGuess(index) {
    if (isLocked && index !== -1) return;

    clearTimeout(gameTimeout);

    const board = document.getElementById('game-board');
    const flash = document.getElementById('flash-overlay');

    if (index === currentLevel.targetIndex) {
        // Success
        isLocked = true;
        score += 100 + (streak * 10);
        streak++;

        // Show Arrow
        const arrow = document.getElementById(`arrow-${index}`);
        arrow.classList.add('visible');

        // Show Explanation
        const toast = document.getElementById('toast');

        if (difficulty !== 'easy' && difficulty !== 'normal') {
            toast.innerText = currentLevel.explanation;
            toast.classList.add('show');
            // Hard Mode: Fast auto-advance
            setTimeout(loadNextLevel, 1500);
        } else {
            // Normal Mode: Manual Advance for learning
            toast.innerHTML = currentLevel.explanation + "<br><br><span style='font-size: 0.8rem; opacity: 0.7; letter-spacing: 1px;'>[ TAP ANYWHERE TO CONTINUE ]</span>";
            toast.classList.add('show');

            const advance = (e) => {
                e.preventDefault();
                e.stopPropagation();
                document.removeEventListener('click', advance);
                document.removeEventListener('keydown', advance);
                // Remove the handler to prevent memory leaks or dual calls
                loadNextLevel();
            };

            // Add listener after a short delay to prevent the current click from triggering it
            setTimeout(() => {
                document.addEventListener('click', advance);
                document.addEventListener('keydown', advance);
            }, 500);
        }

    } else {
        // Failure
        streak = 0;
        if (!missedScenarios.includes(currentLevel.name)) missedScenarios.push(currentLevel.name);
        board.classList.remove('shake-effect');
        void board.offsetWidth;
        board.classList.add('shake-effect');

        flash.style.opacity = '1';
        setTimeout(() => flash.style.opacity = '0', 200);

        if (difficulty !== 'easy' && !isLocked) {
            startTimer();
        }
    }
}

window.restartGame = function restartGame() {
    initGame();
}

// Expose functions to global scope for Playcode
window.handleGuess = handleGuess;
window.restartGame = restartGame;
window.initGame = initGame;

window.onload = initGame;